import React from "react";
import Ass from "./Ass";
import { Link } from "react-router-dom";

const Access = (props) => {
  return (
    <>
      {props.access.map((access, id) => (
        <Link to={`/blogs/${access.id}`}>
          <Ass key={id} access={access} />
        </Link>
      ))}
    </>
  );
};

export default Access;
